import React from 'react';

const RegisterPage: React.FC = () => {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Kayıt Ol</h1>
      <p>Bu formu doldurarak yeni bir hesap oluşturabilirsiniz.</p>
    </div>
  );
};

export default RegisterPage;
